import React from "react";
import {
  Button,
  TextField,
  Link,
  Paper,
  Grid,
  makeStyles,
  Icon,
} from "@material-ui/core";
import {
  Facebook
} from "@material-ui/icons";
import { useHistory } from "react-router-dom";

import { useSimpleForm, useAuthentication } from "../../../hooks";
import Icons from "../../../resources/icons";
import "./login.scss";

const useStyles = makeStyles((theme) => ({
  paper: {
    padding: theme.spacing(8, 4),
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    height: "100%",
    boxSizing: "border-box",
  },
  image: {
    backgroundImage: "url(https://source.unsplash.com/random)",
    backgroundrepeat: "no-repeat",
    backgroundSize: "cover",
    backgroundPosition: "center",
  },
  btnFace: {
    width: 300,
    borderRadius: 10,
    marginBottom: 20,
    backgroundColor: "#1877F2",
    color: "white",
  },
  btnGoogle: {
    width: 300,
    borderRadius: 10,
    marginBottom: 20,
    backgroundColor: "#FFFFFF",
    color: "black",
  },
  btnApple: {
    width: 300,
    borderRadius: 10,
    marginBottom: 20,
    backgroundColor: "#000000",
    color: "white",
  },
  btnLink: {
    width: 300,
    borderRadius: 10,
    marginBottom: 20,
    backgroundColor: "#FFFFFF",
    color: "#0A66C2",
  },
}));

const initialFormValue = { email: "", password: "" };

export const SignInSide = () => {
  const classes = useStyles();
  const history = useHistory();
  const { values, onChange } = useSimpleForm(initialFormValue);
  const { handleAuthentication, operationTypes, providers } =
    useAuthentication();

  const handleAfterAuth = (user) => {
    const nextScreen = user.isNewEntity ? "/register" : "/";
    history.push(nextScreen, { oAuthRegistered: true });
  };

  const handleLogin = (type, ...provider) => {
    handleAuthentication(type, ...provider)
      .then(handleAfterAuth)
      .catch((err) => {
        if (
          (err.message =
            "auth/user-not-found" && type === operationTypes.authByPassAndEmail)
        ) {
          handleAuthentication(
            operationTypes.signUpByPassAndEmail,
            ...provider
          ).then(handleAfterAuth);
        }
      });
  };

  return (
    <Grid container component="main" className="login-screen-container">
      <Grid item xs={12} sm={4} md={7} className={classes.image} />
      <Grid item xs={12} sm={8} md={5} component={Paper} elevation={6} square>
        <div className={classes.paper}>
          <Button variant="contained" className="logo">
            Logo
          </Button>
          <TextField
            variant="outlined"
            margin="normal"
            required
            id="email"
            label="Usuario"
            name="email"
            autoComplete="email"
            className="field"
            value={values.email}
            onChange={onChange}
          />
          <TextField
            variant="outlined"
            margin="normal"
            required
            name="password"
            label="ContraseÃ±a"
            type="password"
            id="password"
            autoComplete="current-password"
            className="field"
            value={values.password}
            onChange={onChange}
          />
          <Link href="#" className="forgot">
            Â¿Olvidaste tu contraseÃ±a?
          </Link>
          <div className="login-button-container box">
            <Button
              type="submit"
              variant="contained"
              color="primary"
              className="login-button"
              onClick={() =>
                handleLogin(
                  operationTypes.authByPassAndEmail,
                  values.email,
                  values.password
                )
              }
            >
              LOGIN
            </Button>
            <Button
              variant="contained"
              className={classes.btnFace}
              onClick={() =>
                handleLogin(operationTypes.oauth, providers.facebookProvider)
              }
            >
              <Facebook />
              Continuar con Facebook
            </Button>
            <Button
              variant="contained"
              className={classes.btnGoogle}
              onClick={() =>
                handleLogin(operationTypes.oauth, providers.googleProvider)
              }
            >
              <Icon>
                <object data={Icons.google} type="image/svg+xml">
                  <img alt="descriptor" src={Icons.google} />
                </object>
              </Icon>
              Continuar con Google
            </Button>
            {/* <Button variant="contained" className={classes.btnApple}>
              <Apple />
              Continuar con Apple
            </Button>
            <Button variant="contained" className={classes.btnLink}>
              <LinkedIn />
              Continuar con Linkedin
            </Button> */}
          </div>
          <Link href="#" className="create-account-label">
            {"Â¿No tienes cuenta? Sign Up"}
          </Link>
        </div>
      </Grid>
    </Grid>
  );
};
